import React, { useState, useEffect } from "react";
import axios from "axios";
function App() {
    const [data, setData] = useState(null);

    useEffect(() => {
        axios.get("/fakeData").then((data) => {
            setData(data);
            console.log(data);
        });
    }, []);

    return (
        <div className="App">
            {typeof data.data === "undefined" ? (
                <p>Loading...</p>
            ) : (
                data.data.map((data, i) => {
                    <p key={i}>data</p>;
                })
            )}
        </div>
    );
}

export default App;
